import React from 'react'
import styled from 'styled-components'
import { Header } from './header'
import { Footer } from './footer'
import {
  Animator,
  ScrollContainer,
  ScrollPage,
  batch,
  Fade,
  FadeIn,
  FadeOut,
  Move,
  MoveIn,
  MoveOut,
  Sticky,
  StickyIn,
  StickyOut,
  Zoom,
  ZoomIn,
  ZoomOut,
} from 'react-scroll-motion'
import { Page1 } from './home-pages/page1'
import { Page3 } from './home-pages/page3'
import { Page4 } from './home-pages/page4'
import { Page5 } from './home-pages/page5'

const Container = styled.div`
  width: 100%;
`

const BodyContainer = styled.div`
  width: 100%;
  height: 100%;
`

const Body = styled.div`
  margin-left: 100px;
  text-align: left;
`

const BodyImg = styled.div`
  margin-right: 100px;
  display: flex;
  align-items: flex-end;
`

const BodyTitle = styled.div`
  margin-top: 260px;
  text-align: left;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 48px;
  line-height: 60px;
  color: #000000;
`

const BodyTitleBold = styled.text`
  ffont-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 48px;
  line-height: 60px;
`

const BodySubTitle = styled.div`
  margin-top: 24px;
  text-align: left;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;
  line-height: 32px;
  color: #797a7b;
`

const SubButton = styled.button`
  margin-top: 64px;
  width: 168px;
  height: 48px;
  background: #5500dd;
  border-radius: 16px;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  color: #ffffff;
  border: none;
`
const ZoomInScrollOut = batch(StickyIn(), FadeIn(), ZoomIn())
const FadeUp = batch(Fade(), Move(), Sticky())
export const HomePage: React.FC = () => {
  return (
    <Container>
      <Header />
      <BodyContainer>
        <ScrollContainer style={{ width: '100%', height: '100%' }}>
          <ScrollPage
            style={{
              width: '100%',
            }}
          >
            <Page1 />
          </ScrollPage>
          <ScrollPage
            style={{
              width: '100%',
              backgroundColor: '#f5f4f7',
            }}
          >
            <Page3 />
          </ScrollPage>
          <ScrollPage
            style={{
              width: '100%',
            }}
          >
            <Page4 />
          </ScrollPage>

          <ScrollPage
            style={{
              width: '100%',
              backgroundColor: '#f5f4f7',
            }}
          >
            <Page5 />
          </ScrollPage>
        </ScrollContainer>
      </BodyContainer>
      <Footer />
    </Container>
  )
}
